import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Routes,
  Link
} from "react-router-dom";

import Video from './Video';
import Home from './Home';
function App() {

  return (
    <Routes>
    <Route  path="/video" element={<Video/>}></Route>
    <Route path="/" element={<Home/>}></Route>
  </Routes>
  );
}

export default App;
